import ICON_GOOGLE from './svgs/icn_google.svg';
import ICON_EYE from './svgs/icn_show.svg';
import ICON_SUCCESS from './svgs/icn_success.svg';
import ICON_CHECKBOX from './svgs/icn_check_off.svg';
import ICON_CHECKBOX_ON from './svgs/icn_check_on.svg';
import ICON_CLOSE from './svgs/icn_close.svg';

export const GOOGLE = ICON_GOOGLE;
export const EYE = ICON_EYE;
export const SUCCESS = ICON_SUCCESS;
export const CHECKBOX = ICON_CHECKBOX;
export const CHECKBOX_ON = ICON_CHECKBOX_ON;
export const CLOSE = ICON_CLOSE;
